import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { AppBar, Toolbar, Typography, Button, Container, Box } from '@mui/material';
import Login from './components/Login';
import Register from './components/Register';
import EventList from './components/EventList';
import EventForm from './components/EventForm';
import ParticipantList from './components/ParticipantList';

const App = () => {
  return (
    <Router>
      <div className="App">
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h6" style={{ flexGrow: 1 }}>
              Event Management
            </Typography>
            <Button color="inherit" component={Link} to="/login">Login</Button>
            <Button color="inherit" component={Link} to="/register">Register</Button>
            <Button color="inherit" component={Link} to="/events">Event List</Button>
            <Button color="inherit" component={Link} to="/event/new">Create Event</Button>
            <Button color="inherit" component={Link} to="/participants">Participants</Button>
          </Toolbar>
        </AppBar>
        <Container>
          <Box my={4}>
            <Routes>
              <Route path="/login" element={<Login />} />
              <Route path="/register" element={<Register />} />
              <Route path="/events" element={<EventList />} />
              <Route path="/event/new" element={<EventForm />} />
              <Route path="/event/:id" element={<EventForm />} />
              <Route path="/participants" element={<ParticipantList />} />
            </Routes>
          </Box>
        </Container>
      </div>
    </Router>
  );
}

export default App;
